var title_f14_22_14699="Safe use of cyclophosphamide";
var content_f14_22_14699=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F60160&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F60160&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for the safe use of daily cyclophosphamide",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Limit duration of CYC use (ideally 6-12 months or less, for remission induction)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Administer medication in morning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Instruct the patient to drink eight 8-oz glasses of water daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Adjust dose to maintain the total white blood cell count &gt; 3500 mm3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Decrease the dose in the settings in renal dysfunction (Table 2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Check complete blood counts (with differential) and serum creatinine levels every 2 weeks (more frequently for those with borderline counts)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monthly urinalyses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Always use pneumocystis carinii prophylaxis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Long-term surveillance for CYC-induced bladder injury",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Rheumatic Disease Clinics of North America 2001. 27(4):863. Copyright &copy; 2001 Elsevier Science.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
