var title_f14_22_14700="Virus induced airway obstruction";
var content_f14_22_14700=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F75402&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F75402&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Potential mechanisms of virus-induced airway obstruction and asthma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Increased airway responsiveness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Increased sensitivity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Increased maximal response",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Altered neural control mechanisms",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Enhanced parasympathetic efferent signal",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Decreased M2 receptor function",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       M2-independent factors",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Sensory C fibers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Increased neuropeptide release",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Loss of neutral endopeptidase",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Defective nonadrenergic, noncholinergic responses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Decreased nitric oxide production",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Altered small airway geometry",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Airway wall thickening",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Plugging of the lumen",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Mucus secretion",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Cellular debris",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Increased airway inflammation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       Nonspecific immune responses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Epithelial cells",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Endothelial cells",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Macrophages and monocytes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Granulocytes",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       T-cell responses to viral infection",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Antigen-independent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       Antigen-specific",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from Am J Respir Crit Care Med 1998; 157:1708.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
