" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 484px\">",
"   <div class=\"ttl\">",
"    Compensations to acute respiratory acidosis and alkalosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 464px; height: 488px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Combined significance bands for plasma pH and concentrations of H+ and HCO3- in acute respiratory acidosis and alkalosis in humans. In uncomplicated acute respiratory acid-base disorders, values for the H+ and HCO3- concentrations will, with an estimated 95 percent probability, fall within the band. Values lying outside the band indicate the presence of a complicating metabolic acid-base disturbance.",
"    <div class=\"footnotes\">",
